import React, { useState } from 'react';

function VideoForm({ onAddVideo, existingVideos }) {
  const [video, setVideo] = useState({
    title: '',
    type: '',
    releaseYear: '',
    director: '',
    genre: '',
    duration: '',
    actors: '',
    watched: false,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setVideo({
      ...video,
      [name]: value,
    });
  };

  const handleAddVideo = () => {
    // Vérifier si une vidéo avec le même titre existe déjà
    const isDuplicate = existingVideos.some((v) => v.title === video.title);

    if (!isDuplicate) {
      onAddVideo(video);
      // Réinitialiser le formulaire
      setVideo({
        title: '',
        type: '',
        releaseYear: '',
        director: '',
        genre: '',
        duration: '',
        actors: '',
        watched: false,
      });
    } else {
      alert('Une vidéo avec le même titre existe déjà.');
    }
  };

  return (
    <div className="video-form">
      <h3>Ajouter/Modifier une vidéo</h3>
      <label>
        Titre:
        <input type="text" name="title" value={video.title} onChange={handleChange} />
      </label>
      <label>
        Type:
        <input type="text" name="type" value={video.type} onChange={handleChange} />
      </label>
      <label>
        Année de sortie:
        <input type="text" name="releaseYear" value={video.releaseYear} onChange={handleChange} />
      </label>
      <label>
        Réalisateur:
        <input type="text" name="director" value={video.director} onChange={handleChange} />
      </label>
      <label>
        Genre:
        <input type="text" name="genre" value={video.genre} onChange={handleChange} />
      </label>
      <label>
        Durée (minutes):
        <input type="number" name="duration" value={video.duration} onChange={handleChange} />
      </label>
      <label>
        Acteurs principaux (séparés par des virgules):
        <input type="text" name="actors" value={video.actors} onChange={handleChange} />
      </label>
      <label>
        Vu:
        <input type="checkbox" name="watched" checked={video.watched} onChange={handleChange} />
      </label>
      <button onClick={handleAddVideo}>Ajouter/Modifier</button>
    </div>
  );
}

export default VideoForm;
